            <div id="Signature" style="font: 12px verdana"><br>
            <p class="MsoNormal" style="margin: 0in 0in 0pt"><span style="font-family: Cambria; font-size: 11pt">Hi,<o:p></o:p></span></p>
            <p class="MsoNormal" style="margin: 0in 0in 0pt"><span style="font-family: Cambria; font-size: 11pt"><o:p>&nbsp;</o:p></span></p>
            <p class="MsoNormal" style="margin: 0in 0in 0pt"><span style="font-family: Cambria; font-size: 11pt">Please send me your resumes to sanjeev@xperttech.com<o:p></o:p></span></p>
            <p class="MsoNormal" style="margin: 0in 0in 0pt"><span style="font-family: Cambria; font-size: 11pt"><o:p>&nbsp;</o:p></span></p>
            <p class="MsoNormal" style="margin: 0in 0in 0pt"><span style="font-family: Cambria; font-size: 11pt"><font color="#003366">VB6 developer with .Net <o:p></o:p></font></span></p>
            <p class="MsoNormal" style="margin: 0in 0in 0pt"><span style="font-family: Cambria; font-size: 11pt"><font color="#003366">Location: <st1:place w:st="on"><st1:city w:st="on">Boston</st1:city>, <st1:state w:st="on">MA</st1:state></st1:place> <o:p></o:p></font></span></p>
            <p class="MsoNormal" style="margin: 0in 0in 0pt"><span style="font-family: Cambria; font-size: 11pt"><font color="#003366">Contract Length: 6 months<o:p></o:p></font></span></p>
            <p class="MsoNormal" style="margin: 0in 0in 0pt"><span style="font-family: Cambria; font-size: 11pt"><font color="#003366">Rate: Open&mdash;Keep Low<o:p></o:p></font></span></p>
            <p class="MsoNormal" style="margin: 0in 0in 0pt"><span style="font-family: Cambria; font-size: 11pt"><o:p>&nbsp;</o:p></span></p>
            <p class="MsoNormal" style="margin: 0in 0in 0pt"><span style="font-family: Cambria; color: red; font-size: 14pt">Need pure VB6 developers. More on VB6 and very les on .Net<o:p></o:p></span></p>
            <p class="MsoNormal" style="margin: 0in 0in 0pt"><span style="font-family: Cambria; font-size: 11pt">&nbsp;<o:p></o:p></span></p>
            <p class="MsoNormal" style="margin: 0in 0in 0pt"><strong><span style="font-family: Cambria; font-size: 11pt">Responsibilities:<o:p></o:p></span></strong></p>
            <p class="MsoNormal" style="text-indent: -0.25in; margin: 0in 0in 0pt 0.5in"><span style="font-family: Cambria; font-size: 11pt">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Research and analyze business requirements, and recommend technical solutions for projects.<o:p></o:p></span></p>
            <p class="MsoNormal" style="text-indent: -0.25in; margin: 0in 0in 0pt 0.5in"><span style="font-family: Cambria; font-size: 11pt">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Develop time estimates and report on project progress.<o:p></o:p></span></p>
            <p class="MsoNormal" style="text-indent: -0.25in; margin: 0in 0in 0pt 0.5in"><span style="font-family: Cambria; font-size: 11pt">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Perform technical implementation tasks for assigned projects including: development specification writing; prototyping and design; in-house <span style="mso-spacerun: yes">&nbsp;</span>software development; vendor package installation; data conversions; debugging; ongoing maintenance and support; and technical training of systems team for backup support.<o:p></o:p></span></p>
            <p class="MsoNormal" style="text-indent: -0.25in; margin: 0in 0in 0pt 0.5in"><span style="font-family: Cambria; font-size: 11pt">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Identify and help reconcile inherent conflicts between high-level objectives, systems architecture and functional requirements in a timely manner.<o:p></o:p></span></p>
            <p class="MsoNormal" style="text-indent: -0.25in; margin: 0in 0in 0pt 0.5in"><span style="font-family: Cambria; font-size: 11pt">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Assist with the conversions of legacy applications and databases.<o:p></o:p></span></p>
            <p class="MsoNormal" style="text-indent: -0.25in; margin: 0in 0in 0pt 0.5in"><span style="font-family: Cambria; font-size: 11pt">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Assist in the integration of external products or services.<o:p></o:p></span></p>
            <p class="MsoNormal" style="text-indent: -0.25in; margin: 0in 0in 0pt 0.5in"><span style="font-family: Cambria; font-size: 11pt">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Serve as technical advisor to other systems team members, working with team to document systems processes, best practices and consistencies.<o:p></o:p></span></p>
            <p class="MsoNormal" style="text-indent: -0.25in; margin: 0in 0in 0pt 0.5in"><span style="font-family: Cambria; font-size: 11pt">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Participate on multiple projects if assigned.<o:p></o:p></span></p>
            <p class="MsoNormal" style="text-indent: -0.25in; margin: 0in 0in 0pt 0.5in"><span style="font-family: Cambria; font-size: 11pt">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Act as development team lead on major applications projects.<o:p></o:p></span></p>
            <p class="MsoNormal" style="margin: 0in 0in 0pt"><strong><span style="font-family: Cambria; font-size: 11pt"><o:p>&nbsp;</o:p></span></strong></p>
            <p class="MsoNormal" style="margin: 0in 0in 0pt"><strong><span style="font-family: Cambria; font-size: 11pt">Education and Experience:<o:p></o:p></span></strong></p>
            <p class="MsoNormal" style="text-indent: -0.25in; margin: 0in 0in 0pt 0.5in"><span style="font-family: Cambria; font-size: 11pt">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; BA/BS with 5+ years experience in client server systems development and support.<o:p></o:p></span></p>
            <p class="MsoNormal" style="text-indent: -0.25in; margin: 0in 0in 0pt 0.5in"><span style="font-family: Cambria; font-size: 11pt">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Supervisory or managerial helpful.<o:p></o:p></span></p>
            <p class="MsoNormal" style="text-indent: -0.25in; margin: 0in 0in 0pt 0.5in"><span style="font-family: Cambria; font-size: 11pt">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Required work experience with the following technologies:<o:p></o:p></span></p>
            <p class="MsoNormal" style="text-indent: -0.25in; margin: 0in 0in 0pt 0.5in"><span style="font-family: Cambria; font-size: 11pt">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Visual Basic 6.0 programming<o:p></o:p></span></p>
            <p class="MsoNormal" style="text-indent: -0.25in; margin: 0in 0in 0pt 0.5in"><span style="font-family: Cambria; font-size: 11pt">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; VB.Net / C#<o:p></o:p></span></p>
            <p class="MsoNormal" style="text-indent: -0.25in; margin: 0in 0in 0pt 0.5in"><span style="font-family: Cambria; font-size: 11pt">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Microsoft SQL Server and/or InterSystems Cache<o:p></o:p></span></p>
            <p class="MsoNormal" style="text-indent: -0.25in; margin: 0in 0in 0pt 0.5in"><span style="font-family: Cambria; font-size: 11pt">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Microsoft Visual Studio<o:p></o:p></span></p>
            <p class="MsoNormal" style="text-indent: -0.25in; margin: 0in 0in 0pt 0.5in"><span style="font-family: Cambria; font-size: 11pt">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Reporting tool equivalent to Crystal Reports<o:p></o:p></span></p>
            <p class="MsoNormal" style="text-indent: -0.25in; margin: 0in 0in 0pt 0.5in"><span style="font-family: Cambria; font-size: 11pt">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Broad experience in programming Graphical User Interfaces (GUI).<o:p></o:p></span></p>
            <p class="MsoNormal" style="text-indent: -0.25in; margin: 0in 0in 0pt 0.5in"><span style="font-family: Cambria; font-size: 11pt">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Experience with assisting in the installation and maintenance of PC vendor packages.<o:p></o:p></span></p>
            <p class="MsoNormal" style="text-indent: -0.25in; margin: 0in 0in 0pt 0.5in"><span style="font-family: Cambria; font-size: 11pt">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ability to evaluate and work with vendors to complete systems integration tasks.<o:p></o:p></span></p>
            <p class="MsoNormal" style="margin: 0in 0in 0pt"><strong><span style="font-family: Cambria; font-size: 11pt"><o:p>&nbsp;</o:p></span></strong></p>
            <p class="MsoNormal" style="margin: 0in 0in 0pt"><strong><span style="font-family: Cambria; font-size: 11pt">Skills Required:<o:p></o:p></span></strong></p>
            <p class="MsoNormal" style="text-indent: -0.25in; margin: 0in 0in 0pt 0.5in"><span style="font-family: Cambria; font-size: 11pt">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ability to communicate well with end users and develop teamwork relationship with staff.<o:p></o:p></span></p>
            <p class="MsoNormal" style="text-indent: -0.25in; margin: 0in 0in 0pt 0.5in"><span style="font-family: Cambria; font-size: 11pt">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ability to handle multiple priorities simultaneously while managing time effectively.<o:p></o:p></span></p>
            <p class="MsoNormal" style="text-indent: -0.25in; margin: 0in 0in 0pt 0.5in"><span style="font-family: Cambria; font-size: 11pt">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Must be able to learn new concepts within a complex and demanding environment<o:p></o:p></span></p>
            <p class="MsoNormal" style="text-indent: -0.25in; margin: 0in 0in 0pt 0.5in"><span style="font-family: Cambria; font-size: 11pt">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Must be willing and able to &ldquo;own&rdquo; the process and take responsibility for meeting challenging deadlines. This will require flexibility in hours from time to time<o:p></o:p></span></p>
            <p class="MsoNormal" style="text-indent: -0.25in; margin: 0in 0in 0pt 0.5in"><span style="font-family: Cambria; font-size: 11pt">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Have both a strong work ethic and a sense of &ldquo;getting it right&rdquo;<o:p></o:p></span></p>
            <p class="MsoNormal" style="text-indent: -0.25in; margin: 0in 0in 0pt 0.5in"><span style="font-family: Cambria; font-size: 11pt">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Solid customer service skills<o:p></o:p></span></p>
            <p class="MsoNormal" style="text-indent: -0.25in; margin: 0in 0in 0pt 0.5in"><span style="font-family: Cambria; font-size: 11pt">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Be a self-starter who is able to organize and manage own workload in a fast-paced environment<o:p></o:p></span></p>
            <p class="MsoNormal" style="text-indent: -0.25in; margin: 0in 0in 0pt 0.5in"><span style="font-family: Cambria; font-size: 11pt">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Have a &ldquo;can do&rdquo; attitude and be willing to do whatever it takes, consistent with the expectations for everyone else in the office<o:p></o:p></span></p>
            <p class="MsoNormal" style="text-indent: -0.25in; margin: 0in 0in 0pt 0.5in"><span style="font-family: Cambria; font-size: 11pt">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Desire to learn the trust business as it relates to assigned technical projects.<br>
            <br>
            Sanjeev Coduru<br>
            sanjeev@xperttech.com<br>
            781-767-7573</span></p>
